import './App.css';
import kpi_styles from './styles/KPI.module.css';

import KPI from './components/KPI';
import LineChart from './components/LineChart';
import Sidebar from './components/Sidebar';

function App() {
  return (
    <>
      <Sidebar></Sidebar>
      <div className={`App grid`}>
        <KPI className={kpi_styles.net_worth}>test1</KPI>
        <KPI className={kpi_styles.inflow}>test2</KPI>
        <KPI className={kpi_styles.expenses}>test2</KPI>
        <LineChart></LineChart>
      </div>
    </>
  );
}

export default App;
